import React from 'react'
import './index.css'

function App() {

  const options = {
    method: 'GET',
    headers: {
      'X-RapidAPI-Key': '66e8119c22msh3fad4b9ccde6f89p1683b1jsn81473db9586a',
      'X-RapidAPI-Host': 'api-football-beta.p.rapidapi.com'
    }
  };

  fetch('https://api-football-beta.p.rapidapi.com/standings?season=2019&league=39', options)
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(err => console.error(err));

  return (
    <div className="App">

    </div>
  )
}

export default App
